import React, { useState, useEffect } from "react";

export default function SuperUserData() {
  const [loading, setLoading] = useState(true);
  const [data, setData] = useState([]);
  useEffect(() => {

    fetch("http://localhost:5000/getAllData")
      .then((response) => response.json())
      .then((data) => {
        setData(data);
        setLoading(false);
      });
  }, []);

  return (
    <div>
      <h2>All Data for Super User</h2>
      {loading ? (
        <p>Loading...</p>
      ) : (
        <div>
          <h3>Users:</h3>
          <ul>
            {data.data.users.map((user) => (
              <li key={user._id}>{user.fname}</li>
            ))}
          </ul>
          <h3>Companies:</h3>
          <ul>
            {company.map((company) => (
              <li key={company._id}>{company.fname} {company.lname}</li>
            ))}
          </ul>
        </div>
      )}
    </div>
  );
}
